DELIMITER $$
CREATE TRIGGER `place_order` AFTER UPDATE ON `cart` FOR EACH ROW BEGIN
UPDATE products set stock=(stock-new.qty) where pid=old.pid and new.stat=1;
END
$$
DELIMITER ;
DELIMITER $$
CREATE TRIGGER `qty_check` BEFORE UPDATE ON `cart` FOR EACH ROW BEGIN
DECLARE var int;

select stock into var from products WHERE old.pid=products.pid;

if(var<new.qty) THEN
set new.qty=var;  
end if;

END
$$
DELIMITER ;

